using System;
using System.Collections.Generic;
using System.Linq;

namespace IsSubsequence
{
    internal class Program
    {
        public static void Main(string[] args)
        {
            var temp = IsSubsequence("leeeeetcode", "");
            Console.WriteLine(temp);
        }
        public static bool IsSubsequence(string s, string t)
        {
            if (String.IsNullOrEmpty(s)) return true;

            var list = new List<int>();
            var i = 0;
            var listT = t.ToList();
            var temp = s[0];
            foreach (var c in s)
            {
                
                if (listT.Contains(c))
                {
                    if (c != temp)
                    {
                        i += Array.IndexOf(listT.ToArray(), c);
                        listT.RemoveRange(0,Array.IndexOf(listT.ToArray(),c));
                    }
                    list.Add(Array.IndexOf(listT.ToArray(),c) + i);
                    listT.RemoveAt(Array.IndexOf(listT.ToArray(),c));
                    if (Array.IndexOf(listT.ToArray(),c) < i)
                    {
                        continue;
                    }
                    i++;
                    temp = c;
                    continue;
                }

                return false;
            }

            var check = list.OrderBy(x => x).ToList();
            return list.SequenceEqual(check);
        }
    }
}